import React from "react";
import { Card, CardActions, CardContent, CardMedia, Button } from "@mui/material";

function CardComp() {
  return (
    <div style={{margin:"50px auto", width:"500px"}}>
      <Card>
        <CardMedia
          title="Panda"
          image="https://i.pinimg.com/564x/3e/d3/e8/3ed3e8ff066c7308b1c0011b4350d954.jpg"
          sx={{height:140}}
        />
        <CardContent>
          <p>
            The giant panda lives in a few mountain ranges in central China,
            mainly in Sichuan, and also in neighbouring Shaanxi and Gansu.[8] As
            a result of farming, deforestation, and other development, the giant
            panda has been driven out of the lowland areas where it once lived,
            and it is a conservation-reliant vulnerable species.
          </p>
        </CardContent>
        <CardActions>
            <Button size="small"> Share</Button>
            <Button size="small"> Comment</Button>
        </CardActions>
      </Card>
    </div>
  );
}

export default CardComp;
